	foreach i $shape_list {
		global $i
		XNewDoc D
		XAddShape D $i
		XUpdateAssemblies D
		if {$shell == "top"} {
			WriteStep D topShell_$num.step a
		} else {
			WriteStep D botShell_$num.step a
		}
		unset D
		set num [expr $num +1]
	}
}
if {[info exist shell-top-union]} {
	set top_shape_list [explode shell-top-union]
	traversalWriteStep $top_shape_list top
}
if {[info exist shell-bot-union]} {
	set bot_shape_list [explode shell-bot-union]
	traversalWriteStep $bot_shape_list bottom
}

.tab {
	width: 100%;
	height: 100%;
	border-left: 1px solid #dcdcdc;
	border-bottom: none;
	padding-top: 2 * @setRemPx;

	font-size: 10px;

	.tab_button_normal {
	}
	.tab_button_selected {
		width: 80%;
		height: 8 * @setRemPx;

		border: 1px solid #e0e0e0;
		border-left: none;
		background-color: #fff;
		display: flex;
		justify-content: center;
		align-items: center;

			width: 100%;
			height: 100%;

			display: flex;
			justify-content: center;
			align-items: center;

			color: #3c9bff;

			line-height: 1.2 * @setRemPx;
			font-size: 1.2 * @setRemPx;
			font-weight: bold;

			text-align: center;
		}
	}
}
.comboBox_panel {
	width: 100%;
	height: 100%;

	.comboBox_container {
		display: flex;
		flex-direction: column;
		justify-content: flex-start;
		align-items: center;
		padding-right: 2.4 * @setRemPx;

		.comboBox_list {
			display: flex;
			flex-direction: column;
			justify-content: flex-start;
			align-items: center;
			width: 100%;

			&:first-child {
				margin-top: 0.6 * @setRemPx;
			}
		}
	}
}

	display: flex;
	flex-direction: column;
}
.smt-preview-header {
	height: 32px;
	display: flex;
	justify-content: space-between;
	.smt-preview-header-left {
		position: relative;
		z-index: 3;
		margin-left: 6px;
		background-color: white;
		display: flex;
		align-items: center;
		.open-editor {
			width: 130px;
			height: 24px;
			line-height: 24px;
			padding: 0 5px;
			margin-right: 6px;
			color: #3399ff;
			font-size: 12px;
			white-space: nowrap;
			border: 1px solid #3399ff;
			border-radius: 3px;
			box-sizing: border-box;
			cursor: pointer;
			display: flex;
			align-items: center;
			img {
				margin-right: 5px;
			}
			&:hover {
				background-color: #e6f7ff;
			}
		}
	}
	.smt-preview-header-center {
		.device-visible-switch {
			line-height: 32px;
			margin-left: 12px;
		}
	}
	.smt-preview-header-right {
		display: flex;
		flex-direction: row;
		text-align: center;
		align-items: center;
		margin-right: 6px;
		.layer-switch {
			margin-left: 30px;
		}
	}
}

.order-title-wrap {
	position: absolute;
	z-index: 2;
	width: 100%;
	height: 32px;
	display: flex;
	justify-content: center;
	.order-title {
		font-size: 16px;
		font-weight: 600;
		// \u8BBE\u7F6E\u6587\u672C\u80FD\u591F\u88AB\u9009\u4E2D\uFF0C\u4EE5\u4FBF\u901A\u8FC7 execCommand('copy') \u590D\u5236\u6587\u672C
		user-select: text;
		cursor: pointer;
		line-height: 32px;
		max-width: calc(100% - 950px);
		white-space: nowrap;
		overflow: hidden;
		text-overflow: ellipsis;
		// #order-id {
		// 	cursor: pointer;
		// }
	}
}

@media screen and (max-width: 1350px) {
	.order-title-wrap {
		width: calc(100% - 475px);
		right: 0;
		.order-title {
			max-width: 95%;
		}
	}
}

		background-color: #ffffff;

	}
}

	color: #ffffff;
	background-color: #fd4f54;
	border: 1px solid #fd4f54;
	&:hover {
		background-color: #fd7978;
		border: 1px solid #fd7978;
	}
	&:active {
		background-color: #d73843;
		border: 1px solid #d73843;
	}
	&.disable {
		border-color: #d9d9d9;
		color: #bfbfbf;
		background-color: #ffffff;
		cursor: no-drop;
	}
}

.eda-btn-sm {
	box-sizing: border-box;
	width: 56px;
	height: 24px;
}
